import React, { useEffect } from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from 'react-router-dom';
import {v4 as uuidV4} from 'uuid';

import TextEditor from './TextEditor';

useEffect(() => {

}, [])

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" exact>
            <Navigate to={`/documents/${uuidV4()}`} />
          </Route>
          <Route path="/documents/:id">
            <TextEditor />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
